package uk.gov.moj.cpp.hearing.query.view.response.hearingresponse;import java.util.Collections;import java.util.List;import uk.gov.justice.core.courts.ProsecutionCase;@SuppressWarnings("squid:S2384")public class ProsecutionCaseResponse {    private List<ProsecutionCase> prosecutionCases;    public ProsecutionCaseResponse() {        this.prosecutionCases = Collections.emptyList();    }    public static ProsecutionCaseResponse.Builder builder() {        return new ProsecutionCaseResponse.Builder();    }    public List<ProsecutionCase> getProsecutionCases() {        return prosecutionCases;    }    public void setProsecutionCases(final List<ProsecutionCase> prosecutionCases) {        this.prosecutionCases = prosecutionCases;    }    public static final class Builder {        private List<ProsecutionCase> prosecutionCases;        public ProsecutionCaseResponse.Builder withProsecutionCases(final List<ProsecutionCase> prosecutionCases) {            this.prosecutionCases = prosecutionCases;            return this;        }        public ProsecutionCaseResponse build() {            final ProsecutionCaseResponse prosecutionCaseListResponse = new ProsecutionCaseResponse();            prosecutionCaseListResponse.setProsecutionCases(prosecutionCases);            return prosecutionCaseListResponse;        }    }}